import * as React from 'react';
import styles from './LayoutHeader.module.less';

interface MenuItem {
  key: string;
  label: string;
}

const MenuItems: MenuItem[] = [
  {
    key: 'aboutMe',
    label: 'About me'
  },
  {
    key: 'projects',
    label: 'Projects'
  }
];
const LayoutHeader: React.FC<{}> = () => {
  return (
    <div className={'layout-Header'}>
      {MenuItems.map(item => (
        <span key={item.key} className={styles.LayoutMenuItem}>{item.label}</span>
      ))}
    </div>
  );
};

export default LayoutHeader;
